import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import Driver from "../agents/Driver";
import Passenger from "../agents/Passenger";

function Screen(props) {
  const driver1 = new Driver({
    loc: { x: 50, y: 60 },
    dest: { x: 100, y: 200 },
  });

  return (
    <div>
      <h1>Some Title</h1>
      <div>{driver1}</div>
      {/* <div>{driver1.</div> */}
      {/* Button to simulate picking up a passenger */}
      {driver1.state === "SEARCHING" && (
        <button
          onClick={() => driver1.search({ location: 10, destination: 20 })}
        >
          Pick up passenger
        </button>
      )}
    </div>
  );
}

export default Screen;
